const RobotoMono100 = `@font-face { font-family: 'Roboto Mono'; font-style: normal; font-weight: 100; src: local('Roboto Mono Thin'), local('RobotoMono-Thin'), url('data:font/woff2;base64,') format('woff2'); }`;
const RobotoMono100italic = `@font-face { font-family: 'Roboto Mono'; font-style: italic; font-weight: 100; src: local('Roboto Mono Thin Italic'), local('RobotoMono-ThinItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const RobotoMono300 = `@font-face { font-family: 'Roboto Mono'; font-style: normal; font-weight: 300; src: local('Roboto Mono Light'), local('RobotoMono-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const RobotoMono300italic = `@font-face { font-family: 'Roboto Mono'; font-style: italic; font-weight: 300; src: local('Roboto Mono Light Italic'), local('RobotoMono-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const RobotoMonoRegular = `@font-face { font-family: 'Roboto Mono'; font-style: normal; font-weight: 400; src: local('Roboto Mono'), local('RobotoMono-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const RobotoMonoItalic = `@font-face { font-family: 'Roboto Mono'; font-style: italic; font-weight: 400; src: local('Roboto Mono Italic'), local('RobotoMono-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
